import React from "react";
import Link from 'next/link';

export default function NavEdit() {
  return (
     <div class='edit-nav'>
       <div class="edit-nav-inner">
       <Link href="#profile"><a class="xs-text hover-accent grey">プロフィール</a></Link>
         <Link href="#settings"><a class="xs-text hover-accent grey">アカウント設定</a></Link>
           <Link href="#password"><a class="xs-text hover-accent grey">パスワード</a></Link>
             <Link href="#mail"><a class="xs-text hover-accent grey">メール通知</a></Link>

                 </div>
     </div>
  );
}

$(function(){
  $('a[href^=#]').click(function(){
    var adjust = 0;
    var speed = 400;
    var href= $(this).attr("href");
    var target = $(href == "#" || href == "" ? 'html' : href);
    var position = target.offset().top + adjust;
    $('body,html').animate({scrollTop:position}, speed, 'swing');
    return false;
  });
});
